import sinon from 'sinon';
import { expect } from 'chai';
import { createQueue } from 'kue';
import createPushNotificationsJobs from './8-job.js';

describe('createPushNotificationsJobs', () => {
  const BIG_BROTHER = sinon.spy(console, 'log');  // Spy on console.log
  const QUEUE = createQueue({ name: 'push_notification_code_test' });

  before(() => {
    QUEUE.testMode.enter(true); // Enter test mode with job events
  });

  after(() => {
    QUEUE.testMode.clear(); // Clear the queue after all tests
    QUEUE.testMode.exit();  // Exit test mode
    sinon.restore(); // Restore the console.log spy
  });

  afterEach(() => {
    BIG_BROTHER.resetHistory(); // Reset the history of the spy after each test
  });

  it('displays an error message if jobs is not an array', () => {
    expect(
      createPushNotificationsJobs.bind(createPushNotificationsJobs, {}, QUEUE)
    ).to.throw('Jobs is not an array');
  });

  it('adds jobs to the queue with the correct type', (done) => {
    expect(QUEUE.testMode.jobs.length).to.equal(0);

    const jobInfos = [
      {
        phoneNumber: '44556677889',
        message: 'Use the code 1982 to verify your account',
      },
      {
        phoneNumber: '98877665544',
        message: 'Use the code 1738 to verify your account',
      },
    ];

    createPushNotificationsJobs(jobInfos, QUEUE);
    expect(QUEUE.testMode.jobs.length).to.equal(2);
    expect(QUEUE.testMode.jobs[0].data).to.deep.equal(jobInfos[0]);
    expect(QUEUE.testMode.jobs[0].type).to.equal('push_notification_code_3');

    // Manually process the jobs in test mode
    QUEUE.process('push_notification_code_3', (job, jobDone) => {
      expect(
        BIG_BROTHER.calledWith('Notification job created:', job.id)
      ).to.be.true;
      jobDone();
      done();
    });
  });

  it('registers the progress event handler for a job', (done) => {
    // Listen for progress events
    QUEUE.testMode.jobs[0].on('progress', (progress) => {
      expect(
        BIG_BROTHER.calledWith('Notification job', QUEUE.testMode.jobs[0].id, `${progress}% complete`)
      ).to.be.true;
      done();
    });

    // Emit progress event
    QUEUE.testMode.jobs[0].emit('progress', 25);
  });

  it('registers the failed event handler for a job', (done) => {
    // Listen for failed events
    QUEUE.testMode.jobs[0].on('failed', (err) => {
      expect(
        BIG_BROTHER.calledWith('Notification job', QUEUE.testMode.jobs[0].id, 'failed:', err.message)
      ).to.be.true;
      done();
    });

    // Emit failed event
    QUEUE.testMode.jobs[0].emit('failed', new Error('Failed to send'));
  });

  it('registers the complete event handler for a job', (done) => {
    // Listen for complete events
    QUEUE.testMode.jobs[0].on('complete', () => {
      expect(
        BIG_BROTHER.calledWith('Notification job', QUEUE.testMode.jobs[0].id, 'completed')
      ).to.be.true;
      done();
    });

    // Emit complete event
    QUEUE.testMode.jobs[0].emit('complete');
  });
});

